import React from "react";

function HomePage() {
    return (
      <div>
        <Link to="/loginpage">
          <img 
            src="Homepage.jpg" 
            alt="Go to Login Page" 
            height="400px" 
            width="400px" 
            style={{ cursor: 'pointer' }}
          />
        </Link>
      </div>
    );
  }
export default Categorypage;
